import React, { useState } from 'react';


function App() {

  const [todos, setTodos] = useState([
    {
    id: 1,
    title: 'Chocolate Cake',

  },
  {
    id: 2,
    title: 'Vanilla Ice Cream',

  }
  ])

  const reverseOrder = () => {

    setTodos([...todos].reverse());
  }

  return (
    <>
    <button onClick={reverseOrder}>reverse</button>

    <table>
      <tbody>
        {todos.map(
          (todo, index) => 
          (
            <ToDo key={index} id={todo.id} createdAt={todo.title} /> 
          )


        )}
      </tbody>
    </table>
    </>

  )
}

export default App;


const ToDo = ({ key, id, createdAt})=>{
  return (
    <div key={key}>
       <tr>
      <td>
        <label>
          {id}
        </label>
      </td>
      <td>
        <label>
          {createdAt}
        </label>
      </td>
    </tr>
    </div>

  )
}
